// src/plugin/toArray.ts
function toArray() {
  return [
    this.year(),
    this.month(),
    this.date(),
    this.hour(),
    this.minute(),
    this.second(),
    this.millisecond()
  ];
}
var plugin = (cls) => cls.prototype.toArray = toArray;
var toArray_default = plugin;
export {
  toArray_default as default
};
